import React from "react"
import Cookie from "js-cookie";
import Strapi from "strapi-sdk-javascript/build/main"
import axios from "axios"



class BookingsView extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            token: Cookie.get('jwt')
        }
    }

    async componentDidMount() {
        let bookings = []
        axios
            .get("https://strapi.luis-backt-und-kocht.de/bookings")
            .then(response => {
                console.log("RESPONSE", response)
                response.data.forEach((booking) => {
                    if (booking.user.username === this.props.user) {
                       bookings.push(booking) 
                    }
                    console.log("Push", bookings)
                })
            })
            .catch(error => {
                // Handle error.
                console.log('Buchungsfehler occurred:', error);
            });
        }




    render() {
        console.log("BookingsViewProps", this.props)
        return (
            <h1>BookingsView</h1>
        )
    }
}

export default BookingsView
